import Available from 'components/Available/Available';
import Benefits from 'components/Benefits/Benefits';
import Rating from 'components/Rating/Rating';
import Features from 'components/Features/Features';
import Customers from 'components/Customers/Customers';
import FaqBlock from 'components/Faq/FaqBlock';
import css from './TikTokLikesPage.module.css';
import tikTokLikes from '../../icons/tiktokLikes.svg';
import { Link } from 'react-router-dom';
import { useState } from 'react';
import TikTokLikes from './TikTokLikes';

const TikTokLikesPage = () => {
  const [tiktoklikes, setTiktoklikes] = useState([
    {
      quantity: 100,
      percent: '30%',
      price: 2.99,
      oldPrice: 4.99,
      savings: 2.01,
      active: true,
    },
    {
      quantity: 250,
      percent: '30%',
      price: 2.99,
      oldPrice: 4.99,
      savings: 2.01,
      active: false,
    },
    {
      quantity: 500,
      percent: '30%',
      price: 2.99,
      oldPrice: 4.99,
      savings: 2.01,
      active: false,
    },
  ]);
  const toggleLikes = index => {
    setTiktoklikes(
      tiktoklikes.map((likes, i) => {
        if (i === index) {
          likes.active = !likes.active;
        } else {
          likes.active = false;
        }

        return likes;
      })
    );
  };

  return (
    <>
      <section className={css.buyLikes}>
        <div className={css.buyLikesTitle}>
          Buy TikTok <span className="pinkText">Likes</span>
          <img className={css.buyLikes} src={tikTokLikes} alt="Downloader" />
          with Instant Delivery
        </div>
        <p className={css.buyLikesText}>
          Besides being the only platform to provide real likes, views and
          followers, we're customizable and offer prices no one else can match.
        </p>
        <div className={css.buyLikesBenefits}>
          <div className={css.supportBlock}>24/7 support</div>
          <div className={css.deliveryBlock}>Quick Delivery Start</div>
          <div className={css.passwordBlock}>No password required</div>
        </div>
        <Link className={css.buyLikesCustomLink} to="/">
          Custom Quantity
        </Link>

        <div className={css.buyLikesQuantityBlock}>
          {tiktoklikes.map(
            (
              { quantity, percent, price, oldPrice, savings, active },
              index
            ) => (
              <TikTokLikes
                info={info}
                index={index}
                key={index}
                toggleLikes={toggleLikes}
              />
            )
          )}
        </div>
      </section>

      <Available />
      <Benefits />
      <Rating />
      <Features />
      <Customers />
      <FaqBlock />
    </>
  );
};

export default TikTokLikesPage;
